- input: "TEXT\x1CC00071365\x1CX0\x1C\x1CF3XA\x1CThis amendment includes changes to
    the disbursements for Astro Data Service.  Those disbursements are now voter drive
    expenses.  All joint Fundraising entries are now on Line 12.  All disbursements
    that are reported administrative are administrative and are not in connection
    with a federal candidate or election.  Salaries paid on the administrative split
